import React from 'react';
import CardList from './Cardlist';
import {robots} from './robo';

const App=()=>{
    return(
        <div>
           <h1>RoboSearch</h1>  
           <input type="text" placeholder="search"></input>
           <CardList robots={robots}/>
        </div>


    )
}
export default App;
